import React from "react";
import { Container, Row, Col } from "react-bootstrap";
function Python() {
  return (
    <div>
      <Container>
        <Row className="row">
          <Col className="col1" lg={3}></Col>
        </Row>
      </Container>
    </div>
  );
}
export default Python;
